import styled from "styled-components";
import Navbar from "../components/Navbar";
import { useContext, useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { AuthContext } from "../context/AuthContext";

const Containter = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 100%;
`;

const ImageContainer = styled.div`
    border-radius: 50%;
    height: 100px;
    width: 100px; 
    overflow: hidden;
    display: flex;
    align-items: center;
    justify-content: center;
`;

const ProfileImage = styled.img`
    object-fit: cover;
    width: 100%;
    height: 100%;
`;

const Head = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`;

const Header = styled.h3`
    font-family: "Poppins", sans-serif;
`;
const Email = styled.p`
    font-family: "Poppins", sans-serif;
`;


const PostImageContainer = styled.div`
    height: 100%;
    width: 20%; 
    overflow: hidden;
    display: flex;
    align-items: center;
    justify-content: center;
`;

const PostImage = styled.img`
    object-fit: cover;
    width: 100%;
    height: 100%;
`;

const PostTitle = styled.p`
    font-family: "Poppins", sans-serif;
`;

const Posts = styled.div`
    display: flex;
    align-items: center;
    width: 80%;
`;

const Post = styled.div`
    display: flex;
    width: 90%;
    background-color: #f2f2f2;
    border-radius: 15px;
    overflow: hidden;
`;

const Section = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 80%;
`;

const PostData = styled.div`
    display: flex;
    flex-direction: column
`;

const Profile = () => {
    const {user} = useContext(AuthContext);
    return (
        <>
            <Navbar/>
            <Containter>
                <ImageContainer>
                    <ProfileImage src={user.profilePicture}/>
                </ImageContainer>
                <Head>
                    <Header>{user.firstName + " " + user.lastName}</Header>
                    <Email>{user.email}</Email>
                </Head>
                <Posts>
                    <Section>
                        <Header>My Posts</Header>
                        <Post>
                            <PostImageContainer>
                                <PostImage src={require("../images/IMG_1547.jpeg")}/>
                            </PostImageContainer>
                            <PostTitle>My CULTR General Meeting Takeaways</PostTitle>
                        </Post>
                    </Section>
                    <Section>
                        <Header>My Favorites</Header>
                        <Post>
                            <PostImageContainer>
                                <PostImage src={require("../images/IMG_1547.jpeg")}/>
                            </PostImageContainer>
                            <PostTitle>My CULTR General Meeting Takeaways</PostTitle>
                        </Post>
                    </Section>
                </Posts>
            </Containter>
        </>
    )
}

export default Profile;
